script: |
  super -f text -I q12204.spq | sort > q12204.out

inputs:
  - name: q12204.spq
    data: |
      SELECT DISTINCT + 95 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - + 92 BETWEEN NULL AND - + col0 * + 0 * + col2 / + - 47 / + ( + 25 );
  - name: tab0

outputs:
  - name: q12204.out
    data: |
